import React, { Component } from 'react';
import Title from '../Title';
import Empty from './Empty';
import {Consumerp} from '../../context'
class Cart extends Component {
    render() {
        return (
            <div>
<Consumerp>
    {value=> {const {cart}=value;
if(cart.length>0){
   return <Title name='My' title='Cart'/>
}
else{
return <Empty/>
}
}}
</Consumerp>
                
            </div>
        );
    }
}

export default Cart;
